      var scenarioJSON = [];
      data.modifications.forEach(function (route) {
          if (route.type === "adjust-dwell-time") {
            route.scale = scale;
            scenarioJSON.push(route);
          }
        }
      );
      cb(scenarioJSON)
    })
}

//Headway
export const Headway = true;
